import React, { Component } from "react";
import { Row, Col } from "reactstrap";

class YFashionCard extends Component {
  render() {
    return (
      <div>
        <div className="image-container">
          <img src={require("../../assets/ephemera14star.pdf")} />
        </div>
        <div className="image-container">
          <img src={require("../../assets/ephemeravers3.pdf")} />
        </div>
        <div className="image-container">
          <img src={require("../../assets/promo.jpg")} />
        </div>
        <div className="image-container">
          <img src={require("../../assets/yfashvintage.pdf")} />
        </div>
      </div>
    );
  }
}

export default YFashionCard;
